import React from 'react';
import { Link } from 'react-router-dom';

const Home = ({ apartments }) => {
  return (
    <div>
      <h1>Appartements disponibles</h1>
      <ul>
        {apartments.map(apartment => (
          <li key={apartment.id}>
            <Link to={`/apartments/${apartment.id}`}>{apartment.title}</Link>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Home;
